response.about:
Часто говорю "Не люблю", а в душе у меня текут слёзы.
Часто говорю "Ненавижу" только для того, чтобы сама поверила в это.
Часто говорю "Прощай" в надежде увидеть человека ещё раз.
Я говорю "Уйди", чтобы человек не видел моих слёз.
Я говорю "Никогда", когда знаю, что это случится вновь.
Я говорю "Разлюбила" когда боюсь признаться в своих чувствах.
Я говорю "Я тебя забыла" когда мысль о человеке не выходит из головы.
Я говорю "Я удалила его номер" когда помню его наизусть.
Я говорю "Между нами все кончено" когда все только начинается.
Иногда я не могу сказать "Люблю", когда боюсь услышать ответ.
Я не доверяю людям и, как минимум, раз в неделю плачусь кому-нибудь в жилетку;
Я не верю в любовь и по ночам плачу в подушку;
Я живу сегодняшним днём и строю планы на завтрашний;
Я из принципа не смотрю новости по телевизору и читаю их в интернете;
Я очень самокритична и люблю только себя;
Я ненавижу наше правительство и с удовольствием отмечаю день независимости;
Я прощаю себе все ошибки и косо смотрю на тех, кто их совершает;
Я не верю в идеальных людей и каждый день в толпе высматриваю свой идеал;
Я выбираю, что мне слушать и невольно подпеваю "Jane Air" где-нибудь на улице;
Я всегда говорю то, что думаю и почти разучилась искренне улыбаться;
Я хочу, чтобы люди принимали меня такой, какя я есть и часами торчу перед зеркалом;
Я любю умные фразы и не понимаю саму себя;
У меня куча нераскрытых таланов, и я ничего не делаю для того, чтобы они раскрылись;
Я ненавижу дни рождения и всегда их отмечаю;
Я обожаю спать до полудня и ставлю будильник на 6 утра;
Я всегда добиваюсь того, что хочу и боюсь быть никому не нужной;
Я пишу свой личный дневник и хочу, чтобы его читали.
Можно расправить крылья и улететь от всего этого навстречу ветру. Но у меня нет крыльев. Потому что я их недостойна…
Я до сих пор верю, что сигареты могут помочь успокоиться;
Я всегда пью по утрам растворимый кофе, хотя потом от него мне становится плохо;
Я пытаюсь влюбиться, хотя понимаю всю абсурдность ситуации;
Я не сплю по ночам, а день весь провожу в мире сновидений;
Я очень люблю черно-белые фотографии;
А ещё я хочу перестать бояться…
